package com.debanshu777.compose_github.network.model.userStats


import kotlinx.serialization.SerialName
import kotlinx.serialization.Serializable

@Serializable
data class Contribution(
    @SerialName("aggregated")
    val aggregated: Int = 0, // 1
    @SerialName("avatar")
    val avatar: String = "", // data:image/png;base64,
    @SerialName("handle")
    val handle: String = "", // education/GitHubGraduation-2022
    @SerialName("issues")
    val issues: Int = 0, // 152
    @SerialName("name")
    val name: String = "", // education
    @SerialName("organization")
    val organization: Boolean = false, // true
    @SerialName("pulls")
    val pulls: Int = 0, // 8168
    @SerialName("stars")
    val stars: Int = 0 // 1401
)